import "./Navbar.css"

export const Content = () => {
    const contentArray = [
        { H1: ".NET", H2: "Item 1", description: "This is the first item" , color:"green"},
        { H1: "HTML", H2: "Item 1", description: "This is the first item" , color:"blue"},
        { H1: "NATIVE MOBILE", H2: "Item 1", description: "This is the first item" , color:"red"},
      
    ];
  return (
    <div className="Container">
            {contentArray.map(item => (
                <div className="bordered-div">
                <span className="text-${item.color}"> {item.H1} </span>
                </div>
            ))}
        </div>
  )
}

export default Content;
